import mynlogo from './Images/myn.png'
function Header(params) {
    return(
<div className="flex h-[80px]">
  <div className="w-[10%]">
  <img src={mynlogo}></img> 
    </div>
  <div className="w-[50%]">
    <div>Men</div>
    <div>W</div>
  </div>
  <div className="w-[25%]">Search</div>
  <div className="w-[15%]">Profile</div>
</div>
    )
} 
export default Header;
